begin

DECLARE count_rows INT;

SET rand_user_id = FLOOR(rand() * 20000 + 10000);
select count(id) into count_rows from pm_sp_unique_user_id where unique_id = rand_user_id;

WHILE count_rows !=0 DO
	SET rand_user_id = FLOOR(rand() * 20000 + 10000);
	select count(id) into count_rows from pm_sp_unique_user_id where unique_id = rand_user_id;
END WHILE;
INSERT into pm_sp_unique_user_id (unique_id) values (rand_user_id);
select @rand_user_id;
End//
