DELIMITER //
CREATE TRIGGER `update_ct_historical_activities_linked_tickets_status` AFTER UPDATE ON `pm_cust_sp_ticketmapping` FOR EACH ROW begin
	

	if (old.closed_flag <> new.closed_flag) then
	SET @message = (select CONCAT('Ticket No. ',new.spticket_no," status was ", new.closed_flag));
	
    call usp_insert_ct_activities
    (
        new.customer_ticket_no,
        'u', 
        'ticket linked',
        old.closed_flag,
        new.closed_flag,
        @message,
        new.modified_by
    );
	end if;

	if (old.del_flag <> new.del_flag) then
	SET @message = (select CONCAT('Ticket No. ',new.spticket_no," was unlinked"));
	
    call usp_insert_ct_activities
    (
        new.customer_ticket_no,
        'u', 
        'ticket unlinked',
        old.del_flag,
        new.del_flag,
        @message,
        new.modified_by
    );
