-- Dumping structure for procedure opstenant2.usp_update_sla_duedate
DROP PROCEDURE IF EXISTS `usp_update_sla_duedate`;
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `usp_update_sla_duedate`(
	IN `p_ticket_number` varchar(50),
	IN `p_sla_duration` int,
	IN `p_sla_unit` varchar(5),
	OUT out_sla_due_date varchar(25)
)
begin

DECLARE sla_due_date DATETIME;
DECLARE ticket_creation_date DATETIME;

SELECT created_on INTO ticket_creation_date FROM pm_cust_ticket WHERE ticket_number = p_ticket_number;

IF p_sla_unit = 'days' THEN
	SET sla_due_date = DATE_ADD(ticket_creation_date, INTERVAL p_sla_duration DAY);
ELSEIF p_sla_unit = 'hours' THEN
	SET sla_due_date = DATE_ADD(ticket_creation_date, INTERVAL p_sla_duration HOUR);
END IF;

UPDATE pm_cust_ticket SET sla_duedate = sla_due_date WHERE ticket_number = p_ticket_number;
SET out_sla_due_date = CONVERT(sla_due_date, char);
select @out_sla_due_date;
end//
DELIMITER ;

